import React, { Fragment } from "react";
import Chef from "../../../interfaces/Chef";
import "./HomePage.scss";
import ChefCard from "../../layout/card/ChefCard";

interface ChefProps {
  chefs: Chef[];
}

const ChefItem: React.FC<Chef> = ({
  key,
  chefName,
  chefImage,
  chefDescription,
  restaurantName,
  restaurantImage,
}: Chef) => {
  return (
    <ChefCard key={key} title={chefName} detail={chefDescription} restaurantImg={restaurantImage} restaurantName={restaurantName} img={chefImage}></ChefCard>
  );
};

const Chefs: React.FC<ChefProps> = ({ chefs }: ChefProps) => {
  const yossiRestaurants = chefs.filter(chef=> chef.chefName === "Yossi Shitrit");
  return (
    <Fragment>
      <div className="chef-container">
        <div className="chef-img">
          <img src={yossiRestaurants[1].chefImage} alt="chef" className="chef-img"></img>
          <h1>{yossiRestaurants[1].chefName}</h1>
        </div>
        <p className="chef-description">{props.detail}</p>
      </div>
      <div className="chefs-restaurants">
        <p className="chef-left-title">{props.title}â€™s restaurants :</p> 
        </div>
      {yossiRestaurants.map((chef) => {
          return (
            <ChefItem
              key={chef.key}
              chefName={chef.chefName}
              chefImage={chef.chefImage}
              chefDescription={chef.chefDescription}
              restaurantName={chef.restaurantName}
              restaurantImage={chef.restaurantImage}
            ></ChefItem>
          );
      })}
    </Fragment>
  );
};

export default Chefs;
